function updatedAt(t) {
  return t.updatedAt;
}

function number(t) {
  return t.number;
}

function make(id, number, createdAt, updatedAt) {
  return {
          id: id,
          number: number,
          createdAt: createdAt,
          updatedAt: updatedAt
        };
}

