              }), ArrayUtils.copyAndSort((function (x, y) {
                    return DateFns.differenceInSeconds(DateFns.decodeISO(y.createdAt), DateFns.decodeISO(x.createdAt));
                  }), js));
}

function versionAt(t) {
  return DateFns.format(t.createdAt, "MMM d, yyyy HH:mm");
}

